@PlcdRmr @RMonociclo -Cuando me mudé se te olvidó decirme que eres nudista.
-Y a ti que descuartizabas personas.
-Mmmm... te diste cuenta, creo que tenemos un problema. #Monoficción

@GramaticaReal -Ice la tarea-gritó el alumno desde el patio.
-Querrás decir hice.
-No, no, yo la ato a una cuerda y la hace subir, no puedo ir hoy a clase.

@La_Alhaja 10 FLUIDO
Hablaba español fluido. Sin embargo no lograba hacerse entender con nadie, o se quedaban petrificados o salían corriendo. Tardó un rato en recordar que no se había transfigurado en humano.
#cuentober

-¿Cómo unos seres tan ridículos pudieron dominar la tierra?
-¿Los humanos? Quién sabe-dijo el paleontólogo al joven dinosaurio.
@historiasmini

@jardindebonsais -Bésame - le dice ardorada, con sus brazos rodeándole el cuello, su mirada fija en la de él.
-Déjame hacer algo mejor, hagamos que esta noche sea eterna- susurra mientras bailan en una sala en penumbra, con un saxo revolucionando sus corazones.
Le clava los dientes en la yugular.

@jardindebonsais -No puedo más, quiero escapar del extrarradio.
Miro hacia la ciudad que me deslumbra con sus luces y oculta la soledad que aterroriza a la muchedumbre.
Tu mano me acaricia y aleja mis sueños de grandeza. Solo entre tus brazos me siento persona. #RetoNefelibataB

@albertochimal -No tengas piedad- susurraba una voz en su cabeza.
-No puedo hacerlo, es mi hijo- lloraba.
-Siempre puedes autoeditar un horror- se resignó.

@megustaescribir Te regalé flores un martes. Sonreíste sorprendido, me encogí de hombros y te devolví la mueca.
-Son dedaleras, cocinadas son deliciosas- acoté.
Sabiendo tu pasión por la cocina me fui convencida de que, tras romperte el corazón, lo pararía para siempre con mi regalo. #martesmge

@La_Alhaja 3 ASADO
-Qué calor, estoy asado – se quejó provocando una estampida entre los asistentes. No sabía si era porque un pollo hablara o porque se moviera tras 4 horas en el horno.
#cuentober

@DeniseDresserG Fe de erratas:

La reforma electoral a la que refirió la politóloga en la mesa de este viernes es del 2007, y no del 2017, como se publicó en el tuit.

Para ver el video completo, visita esta liga 👉 https://t.co/I9lBbfp6Xo

@CajonRelatos Tardé tres años en escapar de esa prisión interestelar, acusado de esclavizar a un perro. Traté de explicarles que entre los humanos era normal y no se consideraba esclavitud. Eso provocó que exterminaran a toda mi raza. Ahora solo pienso en viajar.
#microcuento
#Mismofinal

@La_Alhaja 6 BABEANDO
Una sola mirada suya podía dejarme babeando. O una sonrisa, o un simple gesto. Tuve que alejarme cientos de kilómetros para no sucumbir a ese hechizo que indiscriminadamente me devolvía de nuevo a sus redes donde jugaba conmigo.
#cuentober

@HardFeeling_ El niño estaba preocupado porque iban a sacar el cadáver de Franco del Valle de los Caídos.
-Tranquilo, está muerto y no se va a convertir en zombie.
El pequeño respiró más tranquilo y siguió viendo Bob Esponja en la televisión.

@megustaescribir -Se rompió la cuerda un martes. Me pidió que me esfumara, y lo hice. Mi ausencia fue insuficiente. Necesitaba dilapidar mi recuerdo con medias verdades, rumores y creencias.
-¿Y qué hiciste?
-¿Qué otra cosa podía hacer? Seguir en silencio, pese a todo, seguirla amando. #martesmge

Trastorno Obsesivo Compulsivo.

El policía no tenía pruebas pero sí un as bajo la manga. Solo tuvo que exponer al sospechoso con absoluto desorden los datos de las víctimas para que se delatase.

@Rmonociclo #Monoficción

@jardindebonsais -Te juro que no hablé con la policía- niego pese al vídeo que me evidencia,  sorprendido de que mi suegro, un vejete de casi 80 años blanda con extrema habilidad el martillo.
-Llevo queriendo hacer esto desde el día de tu boda. Gracias por darme la excusa. 
#RetoSituaciónLímite

@La_Alhaja 2 TRANQUILO
Respiró profundamente y entró con aire tranquilo. “Parecía muy normal” dirían los testigos. “Me sujetó la puerta al entrar, se veía encantador” diría otra anciana. Nadie esperaba que empezara a disparar y robara el banco en el que trabajó durante 20 años.
#cuentober

SIGLO XXI
¿Graduado?Trabaja por un salario ridículo con un horario abusivo, compra casa, gasta, haz una familia, compra cosas vanas, gasta más; hola crisis, adiós trabajo, llora una vida frustrada, acaba sin casa y suplicando ayuda a políticos corruptos.

